equation = 2*y - 3*x + 4

# get the slope and y-intercept of the equation
slope = sp.diff(equation, x) / sp.diff(equation, y)
y_intercept = equation.subs(x, 0)

# check the sign of the slope and the y-intercept
if slope > 0:
    if y_intercept > 0:
